import React from 'react'

function logout() {
    const style = {
        position: 'absolute',
        top: '50%',
        transform: 'translateY(-50%)'
    }
    return (
        <div style={style}>
            <h1>You are Logged out</h1>
        </div>
    )
}

export default logout
